import React from 'react';
import { Link } from 'react-router-dom';
import Right from '../components/Right';
import Left from '../components/Left';
import Header from '../components/Header';

function Home() {
    return (
        <div>
          <Header />
          <div className="content">
            <Left />
            <Right />
          </div>
        </div>
      );
}

export default Home;
